  const handleNew = async () => {
    // Your existing code for handling new
  };

  const handleOpen = async () => {
    // Your existing code for handling open
  };

  const handleSave = () => {
    // Your existing code for handling save
  };

  const handleSaveAs = async () => {
    // Your existing code for handling save as
  };

  const exitApp = async () => {
    // Your existing code for handling exit
  };

  const dropdownItems = [
    { label: t("header.new"), action: handleNew },
    { label: t("header.open"), action: handleOpen },
    { label: t("header.save"), action: handleSave },
    { label: t("header.save_as"), action: handleSaveAs },
  ];

  return (
    <Container className="top-bar-container">
      <Row className="top-bar-content">
        {/* Dropdown Menu */}
        <DropdownMenu items={dropdownItems} />

        {/* Other buttons */}
        <button id="termButton" onClick={toggleTerminal}>
          {t("header.terminal")}
        </button>
        <button id="helpButton" onClick={toggleHelp}>
          {t("header.help")}
        </button>
        <button id="exitButton" onClick={exitApp}>
          {t("header.exit")}
        </button>
      </Row>
    </Container>
  );
}
